[{"id":"351528","published":true,"test":false,"name":"Complejo Viva Zapata","hotel_type":{"id":"RES"},"stars":0,"location":{"city":{"id":"4703"},"address":"Los Andes entre Mercedes Sosa y Limay","latitude":-37.328209123105120,"longitude":-57.022382647885140},"checkin":{"from":"15:00"},"checkout":{"to":"11:00"},"information":{"es":"Ubicado a 400 m del centro comercial y la playa de Mar de las Pampas, el Complejo Viva Zapata ofrece cabañas equipadas y piscina climatizada de temporada. El establecimiento, que dispone de Wi-Fi gratis, se encuentra a 6 km de la Terminal de Ómnibus de Villa Gesell.\n\nLas cabañas disponen de un dormitorio y pueden estar situadas en planta alta con balcón o planta baja con patio. Todas cuentan con parrilla individual, cocina equipada y área de estar, además de aire acondicionado y TV LCD por cable. Las unidades superiores poseen hogar a leña.\n\nEntre las comodidades del Complejo Viva Zapata, se incluye estacionamiento gratuito y sector de juegos para niños. Se proporcionan toallas y ropa de cama. Junto a la piscina hay una bañera de hidromasaje y un solárium con sombrillas y tumbonas a disposición.\n\nEl desayuno es artesanal y está incluido en la tarifa y se sirve diariamente en cada cabaña. Está elaborado con productos regionales y consiste en mermeladas, tortas y medialunas acompañados por infusiones calientes y jugo de naranja.\n\nEl Complejo Viva Zapata está situado a 10 km del centro de Villa Gesell y a 30 minutos en auto del centro comercial de Cariló."},"amenities":[{"id":"WAKEUP"},{"id":"JCZHTL"},{"id":"RECEP"},{"id":"INGRAH"},{"id":"SEC24"},{"id":"SOL"},{"id":"SILLAPL"},{"id":"BREAKFST"},{"id":"SOMBR"},{"id":"SECTNI"},{"id":"PARKING"},{"id":"OUSWPOSE"},{"id":"HOT"},{"id":"AIR"},{"id":"PEALAC"},{"id":"PISCCLI"},{"id":"ROOMSVC"},{"id":"TOASAB"}],"main_picture":{"url":"http://media.staticontent.com/media/pictures/b2d3c184-9a24-4a89-bfc6-1e1420155933","id":"b2d3c184-9a24-4a89-bfc6-1e1420155933","width":1920,"height":1437,"order":0,"