"}},{"url":"http://media.staticontent.com/media/pictures/0d473f19-dd2c-4065-aebb-539acd10ce2a","id":"0d473f19-dd2c-4065-aebb-539acd10ce2a","width":2048,"height":1536,"order":8,"picture_category":{"id":"100"}}],"creation_date":"2014-01-01T00:00:00.000Z","last_modified_date":"2015-12-16T14:55:03.000Z"}],"creation_date":"2013-03-11T16:02:59.000Z","last_modified_date":"2016-02-19T23:36:53.000Z"},{"id":"373018","published":true,"test":false,"name":"Cabañas & Apart Utopía","hotel_type":{"id":"CAB"},"stars":0,"location":{"city":{"id":"4703"},"address":"Av. Cruz del Sur entre Juan de Garay y Santa María","zipcode":"7165","latitude":-37.324794080020580,"longitude":-57.023226282525630},"checkin":{"from":"13:00","to":"21:00"},"checkout":{"to":"10:00"},"information":{"es":"Rodeado de bosque y a 150 m del centro comercial de Mar de las Pampas, el complejo Cabañas & Apart Utopía cuenta con personal apto para brindar información turística de la región. El establecimiento, que ofrece Wi-Fi gratis, se encuentra a 500 m de la playa y a 6 km de la Terminal de Ómnibus de Villa Gesell.\n\nLas comodidades que incluye Cabañas & Apart Utopía son servicio de limpieza diario y estacionamiento por un suplemento. Se brinda seguridad durante las 24h y hay alquiler sin cargo de sillas y sombrillas para la playa.\n\nLas cabañas disponen de área de estar con hogar a leña, deck privado con parrilla, ventilador de techo y TV por cable. Además, cuentan con cocina equipada con horno, refrigerador y microondas. Algunas unidades poseen bañera de hidromasaje.\n\nTodas las mañanas se entrega en las cabañas un desayuno continental incluido en la tarifa que consiste en medialunas, tostadas, mermeladas y dulces para untar acompañados por café, leche y té.\n\nCabañas & Apart Utopía está ubicado a 9 km de la zona comercial de la Avenida 3, en Villa Gesell. El centro comercial de Cariló queda a 30 minutos en auto, mientras la ciudad de Mar del Plata se encuentra a 100 km."},"amenities":[{"id":"WAKEUP"},{"id":"M