"15:00"},"checkout":{"to":"10:00"},"information":{"es":"Situado a 150 m de la playa en Mar de las Pampas, el hotel Agua Bay cuenta con una piscina climatizada con techo corredizo. El establecimiento se encuentra a 1 km del centro comercial y a 6.5 km de la Terminal de Ómnibus de Villa Gesell. Ofrece desayuno buffet incluido en la tarifa.\n\nEn el salón comedor se sirve el desayuno, que está compuesto por frutas, cereales, medialunas y dulces. Las infusiones calientes y las bebidas frías también están incluidas.\n\nTodos los departamentos disponen de cocina equipada con anafe eléctrico, microondas y refrigerador. Además, cuentan con TV LCD por cable, aire acondicionado y bañera de hidromasaje. Las unidades de un dormitorio son más amplias y tienen balcón.\n\nLas comodidades del Agua Bay incluyen conexión Wi-Fi gratuita en áreas comunes y habitaciones, estacionamiento gratuito y recepción 24h. El spa del establecimiento ofrece sauna, gimnasio y solárium. Los huéspedes también pueden relajarse en la terraza o en el jardín.\n\nEl hotel Agua Bay está ubicado a 2.5 km de Mar Azul y a 30 minutos en auto del centro comercial de Villa Gesell. El Aeropuerto Internacional de Mar del Plata – Ástor Piazzolla queda a 103 km de la propiedad."},"amenities":[{"id":"WAKEUP"},{"id":"PISC"},{"id":"PISDESC"},{"id":"SPA"},{"id":"SEC24"},{"id":"SOL"},{"id":"BREAKFST"},{"id":"GARD"},{"id":"HOT"},{"id":"AIR"},{"id":"LASESU"},{"id":"JCZHTL"},{"id":"R24"},{"id":"PAREFR"},{"id":"MNA"},{"id":"GIM"},{"id":"SAUN"},{"id":"INGRAH"},{"id":"SILLAPL"},{"id":"PARKING"},{"id":"ELEV"},{"id":"TOALPL"},{"id":"ROOMSVC"},{"id":"PISCCLI"},{"id":"TOASAB"}],"main_picture":{"url":"http://media.staticontent.com/media/pictures/812139fa-df2e-411d-8880-3def5e2b9aeb","id":"812139fa-df2e-411d-8880-3def5e2b9aeb","width":1920,"height":1280,"order":0,"picture_category":{"id":"1"}},"pictures":[{"url":"http://media.staticontent.com/media/pictures/812139fa-df2e-411d-8880-3def5e2b9aeb","id":"812139fa-df2e-411d-8880-3def5e2b9